const initSwiperSlider=()=>{const e=document.querySelector(".proorb-slider");if(e){e.classList.remove("slider--no-js");new Swiper(".proorb-slider",{slidesPerView:1,spaceBetween:130,slidesPerGroup:1,loop:!1,pagination:{el:".swiper-pagination",type:"bullets",clickable:!0,renderBullet:function(e,i){return`<span class="${i}">${e+1}</span>`}},navigation:{nextEl:".swiper-button-next",prevEl:".swiper-button-prev"}})}};document.addEventListener("DOMContentLoaded",(()=>{initSwiperSlider()}));